uv1 = (uv-.2) * aspect.xy;

//BACKGROUND
float z = 16*length(uv1)+time;
float2 uvn =normalize(uv1);
rs = clamp(tan(z)*uvn,-5,5)/2;

//CRYSTAL
float mult = q31;
uv7 = sin(uv1*mult);
uv8 = uv7;
float dist = length(uv8);
dist *= (abs(uv1.x) + abs(uv1.y))+ q32;

float ang2 = atan2 (uv8.y,uv8.x);
ang2 =  .2*floor (4* ang2);
float2 dir = .1*uv8+float2 (cos(ang2), sin(ang2));


z = (1-sin(2*dist));
z = saturate (z);

//ADD
float mask = (z >= .5); //momentan beliebig
rs = q28*rs + (1-q28)*rs.yx;
uv += (1-mask)*.03*(rs.yx) + .5*mask*z*normalize(dir);

//ZENTRALSTRAHL
uv6 = mul (uv1,float2x2(_qb));
mus = abs(0.01/(sqrt(uv6.x)+.001))*(rad+.2);

//DOTS
float2 uv2 = .7*uv1+.3*sin(uv1*16+4*float2 (q5,q6));
uv2 *= .2;
float3 dots = q26*saturate(.001/(length(uv2)));
float3 blur = GetBlur1(frac(uv));
float3 crisp= GetPixel(uv);
float3 diff = (crisp) - .5*blur;
float3 ret1 = crisp + mus + dots;

float3 mod = tex2D (sampler_noise_lq,.5*uv+time*.01)-.2;
mod = 1 - mod*diff;

ret = (1-mask)*ret1*mod + mask*ret1*mod;
ret = ret *.98- .03;

}

